import Home from "./routes/Home";
import UploadImage from "./routes/UploadImage"



function App() {
  return (
   <Router>
    <Header />
    <Routes>
      <Route path='/' exact component={Home}/>
      <Route path='/upload' component={UploadImage}/>
    </Routes>

   </Router>
  );
}

export default App;
